import React, {useState} from "react";
import {BrowserRouter as Router, Link, Route, Switch, useParams} from "react-router-dom";


const Home = (props) => {
    const [degreeName, setDegreeName] = useState("");

    return <Router>
        <div>
            {this.props.allCourses.map((eachCourse, index) => <div key={index}>
                <div id={"deptName-" + index}><h5>{eachCourse.deptName}</h5><span></span></div>
                <Link to={"/" + degreeName} name={eachCourse.crawledCourses.degreeName} onClick={(e) => {
//                        e.preventDefault();
                    setDegreeName(eachCourse.crawledCourses.degreeName.replace(/ /g, ''));
                }}> {eachCourse.crawledCourses.degreeName} </Link>
                <div id={"degreeType-" + index}><span>{eachCourse.degreeType}</span></div>
                <div id={"language-" + index}><span>{eachCourse.crawledCourses.language}</span></div>
                <div id={"uniName-" + index}><a href={eachCourse.crawledCourses.website} rel="link to uni site" target="_blank"> {eachCourse.crawledCourses.uniName}</a><span></span>
                </div>
            </div>)}
            <Switch>
                <Route path="/:degreeName" children={<Child/>}/>
            </Switch>
        </div>
    </Router>
}

function Child() {
    // We can use the `useParams` hook here to access
    // the dynamic pieces of the URL.
    let {degreeName} = useParams();
    return (
        <div>
            <h3>ID: {degreeName}</h3>
        </div>
    );
}

export default Home;
